import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import "./App.css";
import "antd/dist/antd.css";
import Header from "./components/Header";
import Dashboard from "./pages/Dashboard";
import Buy from "./pages/Buy";
import Send from "./pages/Send";
import Swap from "./pages/Swap";
import Home from "./pages/Home";
import Login from "./pages/Login";
import AuthProvider from "./Context/AuthProvider";
import { useAuthState } from "./Context/AuthProvider";

const AuthenticatedRoute = ({ component: C, ...props }) => {
  const { isAuthenticated } = useAuthState();
  return (
    <Route
      {...props}
      render={(routeProps) => (isAuthenticated ? <C {...routeProps} /> : "")}
    />
  );
};

const UnauthenticatedRoute = ({ component: C, ...props }) => {
  const { isAuthenticated } = useAuthState();
  return (
    <Route
      {...props}
      render={(routeProps) => (!isAuthenticated ? <C {...routeProps} /> : "")}
    />
  );
};

function App() {
  const { isAuthenticated } = useAuthState();
  return (
    <div className="App">
      <AuthProvider>
        <BrowserRouter>
          <Header />
          <Routes>
            <UnauthenticatedRoute exact path="/home" component={<Home />} />
            <UnauthenticatedRoute exact path="/login" component={<Login />} />
            <AuthenticatedRoute exact path="/buy" component={<Buy />} />
            <AuthenticatedRoute exact path="/send" component={<Send />} />
            <AuthenticatedRoute exact path="/swap" component={<Swap />} />
            <AuthenticatedRoute exact path="/" component={<Dashboard />} />
          </Routes>
        </BrowserRouter>
      </AuthProvider>
    </div>
  );
}

export default App;
